description:
The return of Doncaster Works, complete with wiper effects and cab light on Class 03, Quick Drive locations and consists, ambient night lighting, moon phases and improved sky dome.

An accurate recreation of Doncaster Works and station, the Doncaster Works Route Add-On includes a Class 03 shunter locomotive (built many years earlier at Doncaster Works) in BR Blue livery, complete with accurate gearing just like the original. Doncaster Works also includes a wealth of other new features such as movable dead locomotives and carriages, dismantled locomotive and carriage bodies and parts, a team of new workmen figures and a fully operational traverser for accessing the highly-detailed maintenance shed. 



Please support the developers and buy some of their content if you can afford it.


Please use the email address for requests and questions and if you want to share an addon with the community then contact us and we will post it on your behalf. If you would like to contribute, please read the Readme.pdf.


